import actionFile from '../actions/file';
const oldState = {
    file:'',
    name:''
}
const fileRd = (state = oldState, action)=>{
    switch (action.type) {
        case actionFile.saveFile().type:
            return {
                ...state,
                file: action.payload.file,
                name: action.payload.name,
            }
        case actionFile.resetFile().type:
            
        default:
            return state;
    }
}
export default fileRd;
